import React from 'react';

import './Map.css';


function Map() {
  return (
<div class="moscow_map">
    <div class="titles"> <h1><a href="">Карта Москвы</a></h1> </div>
    <div class="items_map">
        <a href="#">Метро</a>
        <a href="#">Такси</a>
        <a href="#">Расписание</a>
        <a href="#">Сообщество соседей</a>
    </div>
</div>
  );
}

export default Map;
